import routes from './reouter/index';
import { useRoutes, Outlet } from "react-router-dom"
import './App.less'
import { RequestGet } from './request/api/login'

import { connect } from 'react-redux'

function App (props) {
  const routerView = useRoutes(routes)
  return (
    <div className="app">
      {/**布局 */}
      <Top></Top>
      <Foot></Foot>
      <Banner></Banner>
      <PlayerBar></PlayerBar>
      {routerView}{/**路由出口 */}
    </div>
  )
}

/**state映射 */


export default App
